import './Notes.css'
import Note from './Note'

function Notes({notes}) {
  const noteClicked = (e) => {
    console.log('====================================');
    console.log(e.currentTarget.classList.add('active'));
    console.log('====================================');
  }
  return (
    <div className='notes'>
      {  
        notes?.map(note => <Note 
          key={note.id} 
          title={note.title} 
          content={note.content}
          noteClicked={noteClicked}
          />
        )  
      }
      <button className='add-btn'>+</button>
    </div>
  )
}

export default Notes
